import React, {Component}  from 'react'; 
import { Link} from 'react-router-dom';  
import LeftMenu from './LeftMenu';
import SubCategory from './SubCategory'
import './category.css';

class Category extends Component{
    constructor(props){
        super(props);
        this.state ={
            items: [],
            isLoaded: false,
        }
    }
     
    render(){
        let getCat = this.props.location.search.substring(1,6)
        let callFromSub = ''
        if(this.props.location.search.includes('Static')){
            console.log(getCat+":static");
        }
        
        return(
        <div className="mainDiv CategoryPage"> 
            <div className="featuredProducts"> 
                <div className="leftMenu"><p>Main Menu</p><LeftMenu /></div>
                <div className="imagesHolder"><SubCategory callCat = {getCat} /></div>
            </div>
        </div>
        )
    }
}
 
export default Category;
